import React from 'react';
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import {Card, Col, Container, Row} from "react-bootstrap";
import {Link} from "react-router-dom";

const responsive = {
    superLargeDesktop: {
        breakpoint: {max: 4000, min: 3000},
        items: 5
    },
    desktop: {
        breakpoint: {max: 3000, min: 1024},
        items: 3
    },
    tablet: {
        breakpoint: {max: 1024, min: 464},
        items: 2
    },
    mobile: {
        breakpoint: {max: 464, min: 0},
        items: 1
    }
};

const MainPage = () => {
    return (
        <Container className="">
            <Row className="my-3">
                <Col>
                    <h2 className="my-3">Сообщества</h2>
                    <Carousel responsive={responsive}>
                        <div className="m-4">
                            <div className="res-circle"><Link className="circle-txt">Журнал КОД</Link></div>
                        </div>
                        <div className="m-4">
                            <div className="res-circle"><Link className="circle-txt">Item 2</Link></div>
                        </div>
                        <div className="m-4">
                            <div className="res-circle"><Link className="circle-txt">Item 3</Link></div>
                        </div>
                        <div className="m-4">
                            <div className="res-circle"><Link className="circle-txt">Item 4</Link></div>
                        </div>

                    </Carousel>
                </Col>
            </Row>
            <Row className="my-4">
                <Col>
                    <Card body>This is some text within a card body.</Card>
                </Col>
            </Row>
        </Container>
    );
};

export default MainPage;
